import React from 'react';
import './start-learning.css';

function App() {
    const handleStartLearning = () => {
        window.location.href = '/select.js';
    };

    return (
        <div className="container">
            <div className="left-section">
                <h1>Start learning with Ask Me</h1>
                <p>Get unlimited access to structured courses & doubt clearing sessions.</p>
                <button onClick={handleStartLearning}>Start learning</button>
            </div>
            <div className="right-section">
                <div className="stat-card">
                    <h2>60+</h2>
                    <p>Exam categories</p>
                </div>
                <div className="stat-card">
                    <h2>14k+</h2>
                    <p>Educators</p>
                </div>
                <div className="stat-card">
                    <h2>1.5k+</h2>
                    <p>Daily live classes</p>
                </div>
                <div className="stat-card">
                    <h2>1M+</h2>
                    <p>Video lessons</p>
                </div>
                <div className="stat-card">
                    <h2>3.2B+</h2>
                    <p>Mins. watched</p>
                </div>
            </div>
        </div>
    );
}

export default App;
